{"cells":[{"source":"<a href=\"https://www.kaggle.com/code/shawnkentelem/my-cyclistic-bikeshare-case-study?scriptVersionId=171943776\" target=\"_blank\"><img align=\"left\" alt=\"Kaggle\" title=\"Open in Kaggle\" src=\"https://kaggle.com/static/images/open-in-kaggle.svg\"></a>","metadata":{},"cell_type":"markdown"},{"cell_type":"markdown","id":"ef79c228","metadata":{"papermill":{"duration":0.010412,"end_time":"2024-04-14T09:41:39.830662","exception":false,"start_time":"2024-04-14T09:41:39.82025","status":"completed"},"tags":[]},"source":["# Cyclistic BikeShare Case Study\n","\n","## Shawn Kent Morin,\n","## Aspiring Junior Data Analyst\n","## July 19, 2023\n","\n"]},{"cell_type":"markdown","id":"61340fbd","metadata":{"papermill":{"duration":0.008425,"end_time":"2024-04-14T09:41:39.847611","exception":false,"start_time":"2024-04-14T09:41:39.839186","status":"completed"},"tags":[]},"source":["# Background\n","Lily Moreno, the director of marketing at Cyclistic, a bike-share company in Chicago believes that maximizing the number of annual members will be key to future growth. Rather than creating a marketing campaign that targets all-new customers, Moreno believes there is a very good chance to convert casual riders into annual members. Customers who purchase single-ride or full-day passes are referred to as casual riders. Customers who purchase annual memberships are Cyclistic members. As a \"junior data analyst\" working in the marketing analyst team at Cyclistic. I have been tasked to figure out how annual members and casual riders differ. The idea is so I could give recommendations to help the team develop effective marketing strategy converting casual riders into annual members. Before I could have my recommendations accepted I must first give 6 deliverables (a clear statement of the business task, a description of all data sources used, documentation of any cleaning or manipulation of data, a summary of my analysis, supporting visualizations and key findings, my top three recommendations based on my analysis) for the Cyclistic executive team to approve.\n"]},{"cell_type":"markdown","id":"cf668d9d","metadata":{"papermill":{"duration":0.008308,"end_time":"2024-04-14T09:41:39.86446","exception":false,"start_time":"2024-04-14T09:41:39.856152","status":"completed"},"tags":[]},"source":["# The Business Task\n","Three questions will guide the future marketing program:\n","1. How do annual members and casual riders use Cyclistic bikes differently?\n","2. Why would casual riders buy Cyclistic annual memberships?\n","3. How can Cyclistic use digital media to influence casual riders to become members?\n","\n","In order to figure out how annual members and casual riders differ, Lily Moreno assigned me the first question to answer: **\" How do annual members and casual riders use Cyclistic bikes differently?\"**\n","\n","\n","# Stakeholders\n","\n","● Cyclistic: A bike-share program that features more than 5,800 bicycles and 600 docking stations. Cyclistic sets itself\n","apart by also offering reclining bikes, hand tricycles, and cargo bikes, making bike-share more inclusive to people with\n","disabilities and riders who can’t use a standard two-wheeled bike. The majority of riders opt for traditional bikes; about\n","8% of riders use the assistive options. Cyclistic users are more likely to ride for leisure, but about 30% use them to\n","commute to work each day.\n","\n","● Lily Moreno: The director of marketing and my manager. Moreno is responsible for the development of campaigns\n","and initiatives to promote the bike-share program. These may include email, social media, and other channels.\n","\n","● Cyclistic marketing analytics team: A team of data analysts who are responsible for collecting, analyzing, and\n","reporting data that helps guide Cyclistic marketing strategy. I am a part of this team.\n","\n","● Cyclistic executive team: The notoriously detail-oriented executive team will decide whether to approve the\n","recommended marketing program.\n","\n","\n"]},{"cell_type":"markdown","id":"91d70a4a","metadata":{"papermill":{"duration":0.008432,"end_time":"2024-04-14T09:41:39.881318","exception":false,"start_time":"2024-04-14T09:41:39.872886","status":"completed"},"tags":[]},"source":["# Data Sources Used\n","The data is being stored securely in my personal laptop. They are also being organized by downloading [Cyclistic's 12 most recent datasets](https://divvy-tripdata.s3.amazonaws.com/index.html) (June 2022 - May 2023), giving them proper file-naming conventions and creating a folder to store the 12 most recent datasets. As I attempt to tackle the business task and analyze the datasets, I made sure to have read the licensing and followed their rules and regulations. The accessibility of the data is very secure seeing that it is only accessible through the authorization of Bikeshare. I verified the data’s integrity by cleaning the data. (Checking for any duplicates, sorting and filtering the datasets). Knowing how casual riders and annual members use cyclistic bikes differently should allow us to derive important data for designing an efficient marketing strategy converting casual riders into annual members.\n","\n","# Data Quality Assessment\n","Reliable: ⚠️\n","\n","Missing rows : 309,310 blank rows,\n","\n","Duplicates - There are no duplicates found.\n","\n","Original: ✅\n","The data was gathered by motivate international inc., a first-party group that collects data for Cyclistic.\n","\n","Comprehensive: ✅\n","These datasets are comprehensive enough to be analyzed and is mostly free of human error.\n","\n","Current: ✅\n","The datasets being analyzed are the previous 12 most recent months from June 2022 - May 2023.\n","\n","Cited or Vetted: ✅\n","Data has been carefully examined. "]},{"cell_type":"markdown","id":"4d76f59f","metadata":{"papermill":{"duration":0.008254,"end_time":"2024-04-14T09:41:39.898491","exception":false,"start_time":"2024-04-14T09:41:39.890237","status":"completed"},"tags":[]},"source":["> "]},{"cell_type":"markdown","id":"2596c7b4","metadata":{"papermill":{"duration":0.009426,"end_time":"2024-04-14T09:41:39.91621","exception":false,"start_time":"2024-04-14T09:41:39.906784","status":"completed"},"tags":[]},"source":["# Documentation of data cleaning/manipulation\n","#### Here's a pdf link of my [Data Cleaning.](https://drive.google.com/file/d/1rwtxhlkMElKy5h4HHO5cvY3Ibuha1EXU/view?usp=sharing) \n","\n"]},{"cell_type":"markdown","id":"aa18c229","metadata":{"papermill":{"duration":0.008271,"end_time":"2024-04-14T09:41:39.933143","exception":false,"start_time":"2024-04-14T09:41:39.924872","status":"completed"},"tags":[]},"source":["# SQL Data Manipulation \n","Using bigquery, I used JOINS, subqueries, window functions, and CTEs to answer business questions."]},{"attachments":{"d21f57fc-e3a7-40d2-bfea-bfbeb0fa4a93.png":{"image/png":""}},"cell_type":"markdown","id":"34b1ba5b","metadata":{"papermill":{"duration":0.00818,"end_time":"2024-04-14T09:41:39.950053","exception":false,"start_time":"2024-04-14T09:41:39.941873","status":"completed"},"tags":[]},"source":["![image.png](attachment:d21f57fc-e3a7-40d2-bfea-bfbeb0fa4a93.png)"]},{"attachments":{"5fda8427-d4fc-48b6-936f-4e2e5673f2bc.png":{"image/png":""}},"cell_type":"markdown","id":"d43c6015","metadata":{"papermill":{"duration":0.008729,"end_time":"2024-04-14T09:41:39.96723","exception":false,"start_time":"2024-04-14T09:41:39.958501","status":"completed"},"tags":[]},"source":["![image.png](attachment:5fda8427-d4fc-48b6-936f-4e2e5673f2bc.png)"]},{"cell_type":"markdown","id":"2d408bac","metadata":{"papermill":{"duration":0.008205,"end_time":"2024-04-14T09:41:39.983721","exception":false,"start_time":"2024-04-14T09:41:39.975516","status":"completed"},"tags":[]},"source":["Explanation:\n","\n","1. The CTE ride_data calculates the ride duration in minutes for each ride, categorized by member type (annual member or casual rider).\n","\n","2. The CTE member_usage calculates the total number of rides and the average ride duration for each member type (annual member or casual rider).\n","\n","3. The CTE member_usage_by_day calculates the number of rides per day of the week for each member type.\n","\n","4. The main query joins the results of the previous CTEs and includes additional analysis:\n","\n","* It selects the member type, total rides, average ride duration, day of the week, and rides per day.\n","* It uses a window function (ROW_NUMBER()) to rank member types by total rides.\n","* Results are ordered by member type and rank by total rides."]},{"cell_type":"markdown","id":"cf436d5a","metadata":{"papermill":{"duration":0.008446,"end_time":"2024-04-14T09:41:40.002096","exception":false,"start_time":"2024-04-14T09:41:39.99365","status":"completed"},"tags":[]},"source":["# Analysis Summary"]},{"cell_type":"markdown","id":"50d395b7","metadata":{"papermill":{"duration":0.008366,"end_time":"2024-04-14T09:41:40.018871","exception":false,"start_time":"2024-04-14T09:41:40.010505","status":"completed"},"tags":[]},"source":["### Members Count\n","There are 2,312,073 casual riders and 3,516,957 annual members which makes a total of 5,829,030 cylistic riders."]},{"cell_type":"markdown","id":"9c048a88","metadata":{"papermill":{"duration":0.008266,"end_time":"2024-04-14T09:41:40.03568","exception":false,"start_time":"2024-04-14T09:41:40.027414","status":"completed"},"tags":[]},"source":["### Ride Type Users Count\n","There are three types of bikes. They are classic bikes, docked bikes and electric bikes. The bike with most uses is electric bike with 1,297,103 casual riders and 1,786,292 annual members. "]},{"cell_type":"markdown","id":"5ab01b59","metadata":{"papermill":{"duration":0.008267,"end_time":"2024-04-14T09:41:40.052967","exception":false,"start_time":"2024-04-14T09:41:40.0447","status":"completed"},"tags":[]},"source":["### Max start & end stations count\n","Start station with most casual riders(55,774) is Kingsbury St & Kinzie St. Start station with most annual members(25,285) is Kingsbury St & Kinzie St.\n","\n","End station with most casual riders(58,038) is still Kingsbury St & Kinzie St. End station with most annual members(25,258) is still Kingsbury St & Kinzie St."]},{"cell_type":"markdown","id":"3ab4dcf4","metadata":{"papermill":{"duration":0.00836,"end_time":"2024-04-14T09:41:40.069756","exception":false,"start_time":"2024-04-14T09:41:40.061396","status":"completed"},"tags":[]},"source":["### Weekly Riders Count & Average\n","Casual riders are most active on Saturdays (417,597) and annual members are most active on Wednesday (536,734). \n","\n","On average, Saturday is the day with most casual riders (34,800) and Wednesday is the day with the most annual members (44,728)"]},{"cell_type":"markdown","id":"124a5baa","metadata":{"papermill":{"duration":0.008326,"end_time":"2024-04-14T09:41:40.086429","exception":false,"start_time":"2024-04-14T09:41:40.078103","status":"completed"},"tags":[]},"source":["### Riders' Weekly Ride Time \n","Saturday is the day with most ride time for casual riders (192,384 minutes) and annual members (190,278 minutes)."]},{"cell_type":"markdown","id":"6630bcad","metadata":{"papermill":{"duration":0.008318,"end_time":"2024-04-14T09:41:40.10367","exception":false,"start_time":"2024-04-14T09:41:40.095352","status":"completed"},"tags":[]},"source":["### Monthly Riders Count & Average\n","July is the month with the most casual riders(417,751) and August is the month with the most annual members(434,780).\n","\n","On average, July is the month with most casual riders (139,250) and August with the most annual members(144,927)"]},{"cell_type":"markdown","id":"b9c96ecb","metadata":{"papermill":{"duration":0.009752,"end_time":"2024-04-14T09:41:40.122774","exception":false,"start_time":"2024-04-14T09:41:40.113022","status":"completed"},"tags":[]},"source":["### Riders' Monthly Ride Time\n","July is the month with the most ride time for casual members (193,674 minutes) and annual members (207,927 minutes)"]},{"cell_type":"markdown","id":"05aed4f9","metadata":{"papermill":{"duration":0.00861,"end_time":"2024-04-14T09:41:40.140121","exception":false,"start_time":"2024-04-14T09:41:40.131511","status":"completed"},"tags":[]},"source":["# Supporting visualizations and key findings\n","#### Here's a link of my [Data Visualizations](https://drive.google.com/file/d/1JDp218-myQsN4BzLI458DbDP2EfrKDGt/view?usp=sharing)."]},{"cell_type":"markdown","id":"d77f8cb1","metadata":{"papermill":{"duration":0.00832,"end_time":"2024-04-14T09:41:40.15696","exception":false,"start_time":"2024-04-14T09:41:40.14864","status":"completed"},"tags":[]},"source":["# Top 3 Recommendations\n","These recommendations will further help convert casual riders into annual members. Although, the success rate of these recommendations are inconclusive due to the granularity of the data. However, upon careful analysis, these recommendations are if not one of the best measures to be taken in order to convert casual riders into annual members.\n","\n","**1. Targeted Marketing Campaigns:** Utilize the insights from the data to create targeted marketing campaigns aimed at encouraging casual riders to become annual members. For example, since Saturdays are the day when casual riders are most active, consider offering special promotions, discounts, or benefits for signing up as annual members on Saturdays. Highlight the cost-effectiveness and convenience of being an annual member compared to casual riding. Additionally, focus on the benefits of having access to the more popular electric bikes, which are frequently used by both casual and annual members.\n","\n","Pros:\n","* High Weekend Activity: Since casual riders are most active on Saturdays, a targeted marketing campaign could capitalize on this peak activity, attracting more casual riders.\n","* Monthly Trends: Aligning marketing efforts with the busiest months (July for casual riders, August for annual members) could maximize the impact of campaigns.\n","\n","Cons:\n","* Seasonal Variations: The success of campaigns may vary with seasons, so strategies may need to be adjusted accordingly.\n","* Competing with Peak Times: The challenge of standing out during peak usage times requires careful planning and execution.\n","\n","**2. Enhanced Weekend Experience:** Given that casual riders are more active on Saturdays and Sundays, consider designing special weekend events or guided group rides exclusively for annual members. Emphasize the social aspect and community engagement of being an annual member. This could foster a sense of belonging and make casual riders more inclined to upgrade their membership to take part in these unique experiences.\n","\n","Pros:\n","* Leveraging High Saturday Activity: Improving the weekend experience aligns with the peak activity of casual riders on Saturdays, potentially increasing satisfaction and retention.\n","* Increased Ride Time: As Saturday has the highest ride time for both casual and annual members, enhancing the experience on this day could lead to longer rides.\n","\n","Cons:\n","* Midweek Focus: Since annual members are most active on Wednesdays, the impact of enhanced weekend experiences may be limited for this segment.\n","Infrastructure and Logistics: Implementing changes to enhance the weekend experience requires careful planning and potential investment in infrastructure.\n","\n","**3. Tailored Ride Plans:** Analyze the data on ride times and weekly/monthly trends to create tailored ride plans that cater to the preferences of casual riders. For instance, offer flexible monthly plans that align with their most active days and times. Highlight the value of consistent riding by showcasing how annual membership provides unlimited access to bikes throughout the year, making it more convenient for riders to integrate biking into their routine.\n","\n","Pros:\n","* Monthly and Weekly Preferences: Tailoring plans based on the monthly and weekly trends could attract and retain both casual and annual members during their respective peak times.\n","* Flexibility for Different Rider Types: Considering the variety in rider types (casual, annual), offering tailored plans can cater to the diverse preferences of the user base.\n","\n","Cons:\n","* Communication Challenge: Effectively communicating and marketing tailored ride plans may pose a challenge, requiring clear and targeted messaging.\n","* Implementation Complexity: Creating and managing different plans for various segments may introduce complexities in the operational and billing systems.\n"]}],"metadata":{"kaggle":{"accelerator":"none","dataSources":[],"isGpuEnabled":false,"isInternetEnabled":true,"language":"r","sourceType":"notebook"},"kernelspec":{"display_name":"R","language":"R","name":"ir"},"language_info":{"codemirror_mode":"r","file_extension":".r","mimetype":"text/x-r-source","name":"R","pygments_lexer":"r","version":"4.0.5"},"papermill":{"default_parameters":{},"duration":4.058078,"end_time":"2024-04-14T09:41:40.288073","environment_variables":{},"exception":null,"input_path":"__notebook__.ipynb","output_path":"__notebook__.ipynb","parameters":{},"start_time":"2024-04-14T09:41:36.229995","version":"2.5.0"}},"nbformat":4,"nbformat_minor":5}